// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

/** 
 * @title Ballot
 * @dev Implements voting process along with vote delegation
 */
contract Data {

    struct Patient {
        uint ID; // weight is accumulated by delegation
        uint healthy;  // if true, that person already voted
        bytes32 name;
        bytes32 disease;
        bytes32 medicines;
        uint key;   // index of the voted proposal
    }

    struct Card {
        // If you can limit the length to a certain number of bytes, 
        // always use one of bytes1 to bytes32 because they are much cheaper
        bytes32 name;   // short name (up to 32 bytes)
        uint ID; // number of accumulated votes
    }

    address public author;

    mapping(address => Patient) public patients;

    Card[] public cards;

    constructor(bytes32[] memory cardNames) {
        author = msg.sender;
        patients[author].healthy = 1;

        for (uint i = 0; i < cardNames.length; i++) {
            cards.push(Card({
                name: cardNames[i],
                ID: 0
            }));
        }
    }
}

